import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from '../pages/Home/Home';
import About from '../pages/About/About';  // Импортирање на About компонентата

const AppRouter = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />  // Додавање на About рутата
        {/* Додај и други рути тука ако има потреба */}
      </Routes>
    </Router>
  );
};

export default AppRouter;
